DROP TABLE IF EXISTS `usuarios`;
CREATE TABLE `usuarios` (
  `codigo` varchar(11) COLLATE utf8_spanish_ci NOT NULL COMMENT 'Código principal de la tabla men_usuarios',
  `cedula` varchar(15) COLLATE utf8_spanish_ci NOT NULL COMMENT 'Indica cédula',
  `nombre` varchar(60) COLLATE utf8_spanish_ci NOT NULL COMMENT 'Indica nombre',
  `apellido` varchar(60) COLLATE utf8_spanish_ci NOT NULL COMMENT 'Indica apellido',
  `login` varchar(15) COLLATE utf8_spanish_ci NOT NULL COMMENT 'Usuario',
  `pass` varchar(32) COLLATE utf8_spanish_ci NOT NULL DEFAULT '' COMMENT 'CLave',
  `pass_old` varchar(32) COLLATE utf8_spanish_ci DEFAULT NULL COMMENT 'Clave anterior',
  `email` varchar(60) COLLATE utf8_spanish_ci DEFAULT NULL COMMENT 'Correo electrónico',
  `clave_invalidad` int(3) NOT NULL DEFAULT '0' COMMENT 'Contabiliza El Numero de Erros De Claves.',
  `fec_clave_invalidad` date DEFAULT NULL COMMENT 'Fecha De seguimientos de la claves invalidad o errores',
  `cod_us_ing` varchar(11) COLLATE utf8_spanish_ci NOT NULL COMMENT 'Código del usuario que ingresó',
  `fec_us_ing` date NOT NULL COMMENT 'Fecha del usuario que ingresó',
  `cod_us_mod` date NOT NULL COMMENT 'Código del usuario que modificó',
  `fec_us_mod` date NOT NULL COMMENT 'Fecha del usuario que modificó',
  `status` char(1) COLLATE utf8_spanish_ci NOT NULL COMMENT 'Estatus.Indica si esta activo o inactivo el registro',
  `fec_mod_pass` date NOT NULL COMMENT 'Indica fecha de modificación de password',
  PRIMARY KEY (`codigo`),
  UNIQUE KEY `KU_login` (`login`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci COMMENT='Información sobre el perfil de usuarios';

