DROP PROCEDURE IF EXISTS `p_usuario`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `p_usuario`(metodo VARCHAR(12), cod VARCHAR(12), ced VARCHAR(17),     nomb VARCHAR(17), apell VARCHAR(17), log VARCHAR(17), 
     pass01 VARCHAR(32), pass01_old VARCHAR(32), correo VARCHAR(32), 
 
 act VARCHAR(1))
    READS SQL DATA
    COMMENT 'Inserta o actualiza en la tabla men_usuarios'
BEGIN
 DECLARE clave_error INTEGER(3); 
 DECLARE Vip_old, Vfec_ip_old VARCHAR(16);
 DECLARE fec_error DATE;
  
	IF (metodo = 'agregar') THEN

                apellido, login, pass, pass_old,
                email,  fec_mod_pass, clave_invalidad, r_cliente,
                r_rol,
                cod_us_ing, fec_us_ing, cod_us_mod, fec_us_mod, status)		
        VALUES (cod, ced, nomb,
						    apell, log, pass01, pass01,
							  correo, CURDATE(), 0, rest_cliente,
                rest_rol,
							  usuario, CURDATE(), usuario, CURDATE(), act);	


	ELSEIF (metodo = 'modificar') THEN
		
		UPDATE men_usuarios SET   
								  nombre       = nomb,    apellido   = apell,
							    cod_perfil   = perfil,  email      = correo,
								  login        = log,	
                  r_cliente    = rest_cliente, r_rol = rest_rol,
								  cod_us_mod   = usuario,    fec_us_mod = CURDATE(),
								  status       = act								    
							WHERE codigo = cod;

		IF (checkPass = 'S') THEN
		
			UPDATE men_usuarios SET   
						 pass             =  pass01,
             clave_invalidad  = 0								    
			 WHERE codigo    = cod;

		END IF;

ELSEIF(metodo = 'us_password') THEN

		UPDATE men_usuarios SET   
					 pass             = pass01,     pass_old    =  pass01_old,
           clave_invalidad  = 0,	
					 fec_us_mod   = CURDATE(),      cod_us_mod  = usuario,
					 fec_mod_pass =  CURDATE()
     WHERE codigo = cod;
  
ELSEIF(metodo = 'nomina') THEN
		UPDATE men_usuarios SET   
					 asistencia_orden = as_orden						    
		 WHERE codigo = cod;

ELSEIF(metodo = 'error') THEN

	SELECT men_usuarios.clave_invalidad, men_usuarios.fec_clave_invalidad INTO clave_error, fec_error
		FROM men_usuarios
	 WHERE codigo = cod;

	IF(fec_error =  CURDATE()) THEN

			IF(clave_error > 5) THEN
			
				UPDATE men_usuarios SET   
							 status       = 'F'		
				 WHERE codigo = cod;

			END IF;
	ELSE

		UPDATE men_usuarios SET   
					 clave_invalidad = 0, fec_clave_invalidad = CURDATE()						    
		 WHERE codigo = cod;			
			
		SET clave_error = 0;

	END IF;

	SET clave_error = clave_error +1;

		UPDATE men_usuarios SET   
					 clave_invalidad = clave_error						    
		 WHERE codigo = cod;

ELSEIF(metodo = 'conexion') THEN

		SELECT men_usuarios.ip, men_usuarios.fec_ip INTO Vip_old, Vfec_ip_old
		  FROM men_usuarios
		 WHERE men_usuarios.codigo = cod;

		UPDATE men_usuarios SET   
					 ip        = Vip,        fec_ip = CURDATE(),
           ip_ant    = Vip_old,    fec_ip_ant = Vfec_ip_old,
           captcha   =  Vcaptcha 						    
		 WHERE codigo = cod;

END IF;
END
;;
DELIMITER ;
